e up with meaningful, easy to understand git commit messages, and push them only when reaching reasonable milestones (finishing updates, adding features, changing the design, etc)?</p>',_binary '\0',NULL,'images/Screenshot_(15)161977726717435544.png','NORMAL','user','2021-04-30 15:17:55.442','user','2021-04-30 15:17:55.442',_binary '\0'),(1005,1,1,'How do you come up with the product names?','','<p><span style=\"background-color:rgb(255,255,255);\">Choosing a proper name for your product is equally important as naming variables, functions, classes, etc for code readability and future maintainability.</span></p>',_binary '\0',NULL,'images/Screenshot_(15)161977726717435544.png','NORMAL','user','2021-04-30 15:19:27.365','user','2021-04-30 15:19:27.365',_binary '\0'),(1006,1,1,'How as','','<p>asddddddddddddddddads</p>',_binary '\0',NULL,'images/Screenshot_(15)161977726717435544.png','NORMAL','user','2021-04-30 15:20:17.166','user','2021-04-30 15:20:17.166',_binary '\0'),(1007,1,1,'How can blabla','','<p>asddddss</p>',_binary '\0',NULL,'images/Screenshot_(15)161977726717435544.png','NORMAL','user','2021-04-30 15:22:03.467','user','2021-05-06 17:35:08.623',_binary '\0'),(1009,1,1,'Besides VC, what else do you use GitHub for?','','<p style=\"margin-left:0;\">Most devs love GitHub (or GitLab, Bitbucket, etc) purely for code version control, tho there might be more use cases than that.</p><p>For example, I use it to backup articles from <a href=\"https://hashnode.com/\"><u>Hashnode</u></a> and sketches from <a href=\"https://app.diagrams.net/\"><u>diagrams.net</u></a> (ex draw.io). What else do you use GitHub for?</p>',_binary '\0',NULL,'images/Screenshot_(15)161977726717435544.png','NORMAL','user','2021-04-30 15:23:03.229','user','2021-04-30 15:23:03.229',_binary '\0'),(1010,1,1,'Why you should use Chakra UI in React JS ','Im not going to lie, Chakra UI popped up on my radar because Im a Naruto fan and in the first second I thought I could style it like a ninja.','<p style=\"margin-left:0;\">If you want to build an application or a website you need to take care of many things and in that sea of options which component library, css or ui framework will take a big role in the final version of your product.</p><p style=\"margin-left:0;\">I have tried some component libraries like Material UI, Antd, React Boostrap and other CSS frameworks like styled-components, TailwindCSS and so on, I even tried to make some mini set of components for myself with <a href=\"https://github.com/dastasoft/react-ui-components\"><u>React and Bit</u></a>.</p>',_binary '\0',NULL,'images/4161992180397484712.png','NORMAL','user','2021-05-02 02:17:54.586','user','2021-05-02 07:46:39.073',_binary '\0'),(1011,1,1,'Test notification asdfgas','','<p>Test notificationsddd</p>',_binary '\0',NULL,'images/home_introduce162061309612892095.jpg','NORMAL','user','2021-05-10 02:18:53.896','user','2021-05-31 14:37:15.771',_binary '\0'),(1012,1,1,'Test notification','','<p>Test notification</p>',_binary '\0',NULL,'images/home_introduce162061309612892095.jpg','NORMAL','user','2021-05-10 02:19:30.532','user','2021-08-06 17:28:00.871',_binary ''),(1013,1,1,'Test notification haha ok ok','','<p>Test notification ok</p>',_binary '\0',NULL,'images/home_introduce162061309612892095.jpg','NORMAL','user','2021-05-10 02:20:23.607','user','2021-05-31 14:15:49.183',_binary ''),(1015,1,1,'hi','','<p>sdfdsfdsfdsf</p>',_binary '\0',NULL,'images/MicrosoftTeams-image162122370833110495.png','NORMAL','user','2021-05-17 03:55:29.057','anonymousUser','2021-05-17 16:02:29.380',_binary ''),(1016,864,1,'Test notify follow function','','<p>adjiagasjkalvvmc,c,</p>',_binary '\0',NULL,'','NORMAL','user718','2021-05-22 14:02:09.840','user718','2021-05-22 14:02:09.840',NULL),(1019,1,1,'Nothing to show','','<p>Nothing to show</p>',_binary '\0',NULL,'','NORMAL','user','2021-05-30 16:05:48.177','user','2021-05-30 16:05:48.177',NULL),(1020,1,1,'Nothing to show','','<p>Nothing to show</p>',_binary '\0',NULL,'',