;</p><p>sf iaosfd ds fjk ag ads k;fads&nbsp;</p>',_binary '\0',NULL,'','NORMAL','user999','2021-07-24 14:06:19.478','user999','2021-07-24 14:06:19.478',_binary '\0'),(1090,1,1,'asfd','asdf','<p>asdf</p>',_binary '\0',NULL,'','NORMAL','user','2021-07-24 14:11:15.642','user','2021-08-06 17:26:49.799',_binary ''),(1091,1,1,'asdfasdf','asdasfd','<p>asdfasdf</p>',_binary '\0',NULL,'','NORMAL','user','2021-07-25 09:37:19.484','user','2021-07-25 09:37:19.484',_binary '\0'),(1092,1,1,'dinh cua chop','qua dinh','<p>dinh vl</p>',_binary '\0',NULL,'images/Screen_Shot_2021-07-26_at_21.49.26162740812958863853.png','NORMAL','user','2021-07-27 17:49:22.862','user','2021-07-27 17:49:22.862',_binary '\0'),(1093,124,1,'Front end vs back end developer salary','Which job title has a higher salary: a front end developer or back end developer?','<p style=\"margin-left:0px;\">When comparing front end vs back end developer salary, the question is back end developer a higher paid career path?</p><p style=\"margin-left:0px;\">According to some sources, the difference is as little as 1%, while other sources (such as Glassdoor) suggest that back end engineers can earn even <strong>25% more</strong> than front end developers! There is definitely a pattern suggesting that back end software development comes with higher salaries.</p>',_binary '\0',NULL,'images/unnamed16276545230403368.jpg','NORMAL','user917','2021-07-30 14:15:32.180','user917','2021-07-30 14:15:32.180',_binary '\0'),(1094,1,1,'Tìm hiểu MYSQL Architecture','Đến với tháng 4, tháng của những lời nói dối','<h2 style=\"margin-left:0px;\"><strong>Mở đầu</strong></h2><p>Đến với tháng 4, tháng của những lời nói dối. Thì tôi sẽ đưa các bạn đi tìm về một sự thật thú vị. Đó là sự thật về kiến trúc của mysql. Một hệ quản trị cơ sở dữ liệu quan hệ mã nguồn mở (RDBMS) phổ biến nhất hiện nay.</p><h2 style=\"margin-left:0px;\"><strong>Major components &amp; Layer</strong></h2><p>MYSQL Architecture mô tả cách mà những component trong mysql tương tác với nhau. Về cơ bản thì MYSQL Architecture là một hệ thống client - server system. Với Client là chỉ các ứng dụng kết nối tới Máy chủ cơ sở dữ liệu MySQL. Và server system chính là Máy chủ cơ sở dữ liệu MySQL. MYSQL Architecture sẽ bao gồm các thành phần chính sau:</p><figure class=\"image\"><img src=\"https://images.viblo.asia/a50cffe7-bf45-4da4-99a7-d7b7e605256b.png\" alt=\"\" srcset=\"https://images.viblo.asia/retina/a50cffe7-bf45-4da4-99a7-d7b7e605256b.png 2x\" sizes=\"100vw\"></figure><p>Để khái quát hơn thì tôi xin chia MYSQL Architecture thành 3 layer chính bao gồm :</p><p>Application Layer (layer 1)</p><p>MySQL Server layer (layer 2)</p><p>Storage Engine Layer (layer 3)</p><figure class=\"image\"><img src=\"https://images.viblo.asia/737c9d67-99e6-4e7a-9756-16532759cdf3.png\" alt=\"\" srcset=\"https://images.viblo.asia/retina/737c9d67-99e6-4e7a-9756-16532759cdf3.png 2x\" sizes=\"100vw\"></figure><h2 style=\"margin-left:0px;\"><strong>Application Layer</strong></h2><p>Application Layer chính là lớp trên cùng nhất trong kiến trúc MySQL. Đây là nơi client và user dùng tương tác với MySQL RDBMS. Một số dịch vụ được cung cấp bên dưới: <strong>connection handling</strong>, <strong>authentication</strong>, <strong>security</strong> đều có ở đây. Có ba thành phần chính trong lớp này là Administrators, Clients, Query Users như thể hiện trong hình bên dưới.</p><figure class=\"image\"><img src=\"https://images.viblo.asia/717fed47-8adf-4455-959c-8957195f5356.png\" alt=\"\" srcset=\"https://images.viblo.asia/retina/717fed47-8adf-4455-959c-8957195f5356.png 2x\" sizes=\"100vw\"></figure><p><strong>Administrators</strong> sử dụng các tiện ích và giao diện quản trị khác nhau như mysqladmin thực hiện các tác vụ như tắt máy chủ và tạo hoặc hủy cơ sở dữ liệu, mysqldump để sao lưu cơ sở dữ liệu hoặc sao chép cơ sở dữ liệu sang một máy chủ khác.</p><p><strong>Clients</strong> giao tiếp với MySQL thông qua các giao diện và tiện ích khác nhau như MySQL API. MySQL API gửi truy vấn đến máy chủ dưới dạng một chuỗi các mã thông báo.</p><p><strong>Query Users</strong> truy vấn tương tác với MySQL RDBMS thông qua giao diện truy vấn là mysql .</p><h2 style=\"margin-left:0px;\"><strong>Connection handling</strong></h2><p>Khi một client kết nối với server, Client sẽ nhận được thread riêng cho kết nối của nó. Tất cả các truy vấn từ client đó được thực thi trong thread được chỉ định đó. Thread được lưu trong bộ nhớ cache của máy chủ, vì vậy chúng không cần phải tạo và hủy mỗi khi có kết nối mới.</p><p>Để quản lý số kết nối thì mysql có cung cấp cho ta biến max_connection. Có 1 tip nhỏ đấy chính là <a href=\"https://dev.mysql.com/doc/refman/8.0/en/mysqld.html\">mysqld</a> cho phép max_connections + 1 kết nối Client. Với điều kiện kết nối bổ sung là các tài khoản có CONNECTION_ADMIN. Bằng cách cấp đặc quyền cho administrators , Nó có thể kết nối với máy chủ và sử dụng SHOW PROCESSLIST để chẩn đoán sự cố ngay cả khi số lượng kết nối từ Client đã đạt mức tối đa.</p><p>Khi đặt giá trị của max_connections chúng ta nên cân nhắc đến một số yếu tố sau:</p><p>Chất lượng của thread library trên một platform nhất định.</p><p>Dung lượng RAM có sẵn.</p><p>Dung lượng RAM được sử dụng cho mỗi kết nối.</p><p>Khối lượng công việc từ mỗi kết nối.</p><p>Thời gian phản hồi mong muốn.</p><p>Số lượng file mô tả có sẵn.</p><h2 style=\"margin-left:0px;\"><strong>Authentication</strong></h2><p>Bất cứ khi nào client kết nối với MySQL server, máy chủ sẽ thực hiện xác thực ở phía máy chủ. Việc xác thực dựa trên username, password và host của client.</p><p>Ví dụ:</p><pre><code class=\"language-plaintext\">root@localhost root:  username của Client.\nlocalhost: tên host\n</code></pre><h2 style=\"margin-left:0px;\"><strong>Security</strong></h2><p>Sau khi Client được kết nối thành công với MySQL Server, server sẽ kiểm tra xem client đó có đặc quyền đưa ra các truy vấn nhất định đối với máy chủ MySQL.</p><p>Ví dụ:</p><pre><code class=\"language-plaintext\">mysql&gt; show privileges \\G\n*************************** 1. row ***************************\n  Privilege: Alter\n  Context: Tables\n  Comment: To alter the table\n*************************** 2. row ***************************\n  Privilege: Alter routine\n  Context: Functions,Procedures\n  Comment: To alter or drop stored functions/procedures\n</code></pre><h2 style=\"margin-left:0px;\"><strong>MySQL Server layer</strong></h2><p>Lớp này đảm nhất tất cả các chức năng logic của hệ thống mysql RDBMS, Nó còn được ví như bộ não của mysql. Lớp logic của MySQL được chia thành các thành phần phụ khác nhau, được đưa ra dưới đây:</p><ul><li>MySQL services and utilities.</li><li>SQL Interface.</li><li>SQL Parser.</li><li>Optimizer.</li><li>Caches.</li></ul><h2 style=\"margin-left:0px;\"><strong>MySQL services and utilities</strong></h2><p>Mysql cung cấp nhiều loại dịch vụ và tiện ích. Đây là một trong những lý do chính cho sự phổ biến của MySQL. Lớp này cung cấp các dịch vụ và tiện ích để quản trị và bảo trì hệ thống MySQL, một số trong số chúng được đề cập dưới đây:</p><ul><li>Backup &amp; recovery.</li><li>Security.</li><li>Replication.</li><li>Cluster.</li><li>Partitioning.</li><li>Workbench.</li></ul><h3 style=\"margin-left:0px;\"><strong>Backup &amp; recovery</strong></h3><p>Có một điều quan trọng là phải sao lưu cơ sở dữ liệu để bạn có thể khôi phục dữ liệu của mình và chạy lại trong trường hợp xảy ra sự cố, chẳng hạn như sự cố hệ thống, lỗi phần cứng hoặc người dùng xóa nhầm dữ liệu. Bản sao lư cũng rất cần thiết như một biện pháp bảo vệ trước khi nâng cấp cài đặt MySQL và chúng có thể được sử dụng để chuyển cài đặt MySQL sang hệ thống khác hoặc thiết lập máy chủ bản sao.</p><p>Ví dụ sao lưu bằng Command-Line trong mysqldump:</p><pre><code class=\"language-plaintext\">1. Sao lưu database trong mysql: \nsudo mysqldump -u [user] -p[database_name] &gt; [filename].sql \n\n2. Để sao lưu toàn bộ Hệ thống quản lý database:\nmysqldump --all-databases --single-transaction --quick --lock-tables=false &gt; full-backup-$(date +%F).sql -u root -p\n</code></pre><h3 style=\"margin-left:0px;\"><strong>Security</strong></h3><p>MySQL sử dụng bảo mật dựa trên Danh sách kiểm soát truy cập (ACL) cho tất cả các kết nối, truy vấn và các hoạt động khác mà người dùng có thể cố gắng thực hiện. Ngoài ra còn có hỗ trợ cho các kết nối được mã hóa SSL giữa máy khách và máy chủ MySQL.</p><p>Khi chạy mysql hãy làm theo 1 số nguyên tắc sau:</p><ul><li>Một điều quan trong là <strong>đừng bao giờ cấp cho bất kỳ ai</strong> (ngoại trừ tài khoản root của MySQL ) <strong>quyền truy cập</strong> vào bảng user trong mysql cơ sở dữ liệu hệ thống!</li><li>Tìm hiểu cách hoạt động của hệ thống đặc quyền truy cập MySQL ( xem chi tiết <a href=\"https://dev.mysql.com/doc/mysql-security-excerpt/5.7/en/access-control.html\">tại đây</a>). Không cấp nhiều đặc quyền hơn mức cần thiết. Và không bao giờ cấp đặc quyền cho tất cả các máy chủ. Sử dụng lệnh SHOW GRANTS để kiểm tra những tài khoản nào có quyền truy cập vào những gì. Sau đó, sử dụng lệnh REVOKE để loại bỏ những đặc quyền không cần thiết.</li><li>Không lưu trữ mật khẩu một các rõ ràng. Thay vào đó hay sử dụng , hãy sử dụng SHA2() hoặc một số hàm hash một chiều khác và lưu trữ giá trị hash.</li><li>Thiết lập firewall, Điều này bảo vệ bạn khỏi ít nhất 50% tất cả các loại khai thác trong bất kỳ phần mềm nào. Đặt MySQL sau firewall hoặc trong demilitarized zone (DMZ).</li><li>Các ứng dụng của MYSQL không được tin tưởng bất kì dữ liệu gì mà được người dùng nhập vào. Mọi câu lệnh phải được mã hoá thích hợp. Đây cũng cách để phòng tránh 1 trong những tấn công nghiêm trọng và phổ biến nhất là tấn côngsql injection.</li><li>Không truyền dữ liệu thuần túy (không được mã hóa) qua Internet. Thông tin này có thể truy cập được đối với tất cả những người có thời gian và khả năng chặn nó và sử dụng nó cho mục đích riêng của họ. Thay vào đó, hãy sử dụng giao thức được mã hóa như SSL hoặc SSH. MySQL hỗ trợ các kết nối SSL nội bộ. Một kỹ thuật khác là sử dụng chuyển tiếp cổng SSH để tạo một đường hầm được mã hóa (và nén) cho giao tiếp.</li><li>Tìm hiểu cách sử dụng các tiện ích <strong>tcpdump</strong> và <strong>strings</strong> .</li></ul><h3 style=\"margin-left:0px;\"><strong>Replication</strong></h3><p>Replication MySQL là một quá trình cho phép dữ liệu từ một máy chủ cơ sở dữ liệu MySQL (máy chủ) được sao chép tự động sang một hoặc nhiều máy chủ cơ sở dữ liệu MySQL (máy chủ). Nghe có thể hơi giống phần <strong>Backup &amp; recovery</strong>. Nhưng không phải Replication thường được sử dụng để lan truyền quyền truy cập đọc trên nhiều máy chủ, để có khả năng mở rộng. Mặc dù nó cũng có thể được sử dụng cho các mục đích khác như chuyển đổi dự phòng hoặc phân tích dữ liệu trên máy chủ để không làm quá tải máy chủ.</p><p>Giải thích 1 chút nhé, có 1 nguyên lý quan trọng trong mysql đó là tính toàn vẹn dữ liệu. Và khái niệm lock cũng sinh ra để đảm bảo nguyên lý trên. Nhưng cuộc sống mà, làm gì có thứ gì hoàn hảo. Lock cũng tồn tại khá nhiều nhược điểm như: làm giảm tốc độ truy cập, khó scale... Đến đây, Bằng Replication ta có thể thiết kế những DB phục vụ những chức năng chuyên biệt dành để đọc, ghi.</p><figure class=\"image\"><img src=\"https://images.viblo.asia/c19e8881-d559-4e79-adb9-2b18b89e8834.png\" alt=\"\" srcset=\"https://images.viblo.asia/retina/c19e8881-d559-4e79-adb9-2b18b89e8834.png 2x\" sizes=\"100vw\"></figure><h3 style=\"margin-left:0px;\"><strong>Cluster</strong></h3><p>MySQL Cluster là cơ sở dữ liệu phân tán kết hợp khả năng mở rộng liên tục và tính sẵn sàng cao. Nó cung cấp truy cập thời gian thực trong bộ nhớ với sự nhất quán về tiến trình xử lý trên các bộ dữ liệu phân tán và phân vùng. Nó được thiết kế cho các ứng dụng quan trọng. MySQL Cluster có bản sao giữa các cụm (Cluster) trên nhiều trang web địa lý được tích hợp sẵn. MySQL Cluster được chứng minh hàng ngày trong các hệ thống phục vụ hàng tỷ người dùng. Nó được sử dụng trong nhiệm vụ quan trọng, ứng dụng cốt lõi của mạng điện thoại di động, hệ thống xác thực và trò chơi nền tảng với khối lượng dữ liệu bùng nổ và lượng người dùng tải.</p><h3 style=\"margin-left:0px;\"><strong>Partitioning</strong></h3><p>Mysql Partitioning theo đúng như tên của nó là việc phân chia một table thành những phần nhỏ theo một logic nhất định, được phân biệt bằng key, key này thường là tên column trong table.</p><figure class=\"image\"><img src=\"https://images.viblo.asia/21ea6d0f-5cb9-4076-b4f6-a4d13dc94d6a.png\" alt=\"\" srcset=\"https://images.viblo.asia/retina/21ea6d0f-5cb9-4076-b4f6-a4d13dc94d6a.png 2x\" sizes=\"100vw\"></figure><h3 style=\"margin-left:0px;\"><strong>Workbench</strong></h3><p>MySQL Workbench là một công cụ trực quan hợp nhất dành cho database architects, developer và DBA. MySQL Workbench cung cấp data modeling, SQL development và các công cụ quản trị toàn diện để cấu hình máy chủ, quản trị người dùng, sao lưu và hơn thế nữa. MySQL Workbench có sẵn trên Windows, Linux và Mac OS.</p><h2 style=\"margin-left:0px;\"><strong>SQL Interface</strong></h2><p>Structured Query Language (SQL) là một ngôn ngữ truy vấn, được sử dụng để truy vấn máy chủ MySQL. Nó là một công cụ để tương tác giữa người dùng máy khách MySQL và máy chủ. Một số thành phần SQL Interface :</p><ul><li>Data Manipulation Language (DML).</li><li>Data Definition Language (DDL).</li><li>Stored Procedures.</li><li>Views.</li><li>Triggers.</li></ul><h2 style=\"margin-left:0px;\"><strong>Parser</strong></h2><p>Máy chủ MySQL nhận các truy vấn ở định dạng SQL. Sau khi nhận được một truy vấn, trước tiên nó cần được phân tích cú pháp. Quá trình này được gọi tắt là Parser. MySQL phân tích cú pháp các truy vấn để tạo cấu trúc bên trong (Parser tree). MySQL parser hoạt động như một trình biên dịch truyền đơn. Theo nội bộ MySQL, cấu trúc trình phân tích cú pháp được đưa ra bên dưới.</p><ul><li>Lexical analysis (phân tích từ vựng): Ở gian đoạn này các câu truy vấn sẽ được chia thành các tokens và các thành phần không thể chia (ví dụ như tên cột, tên bảng,..). Đây cũng là giai đoạn đầu tiên của quá trình.</li><li>Syntactic analysis (phân tích cú pháp): phân tích ngữ nghĩa (đảm bảo rằng những câu này có ý nghĩa) và tạo code (cho trình biên dịch) . Tất cả chúng đều được thực hiện cùng một lúc, trong giai đoạn code.</li></ul><p>Cuối cùng, một Parser tree được tạo ra, bây giờ là công việc của Optimizer.</p><h2 style=\"margin-left:0px;\"><strong>Optimizer</strong></h2><p>Sau khi tạo Parser tree nội bộ, MySQL áp dụng nhiều kỹ thuật tối ưu hóa khác nhau. Các kỹ thuật này có thể bao gồm, viết lại truy vấn, thứ tự quét các bảng và chọn các index phù hợp để sử dụng. Trên thực tế, bạn có thể yêu cầu máy chủ giải thích các khía cạnh khác nhau của việc tối ưu hóa. Ví dụ:</p><pre><code class=\"language-plaintext\">EXPLAIN SELECT * FROM users;\n</code></pre><h2 style=\"margin-left:0px;\"><strong>Caches</strong></h2><p>MySQL cache (bộ đệm truy vấn) lưu trữ các bộ kết quả hoàn chỉnh cho các câu lệnh SELECT . Trước khi Parser truy vấn, máy chủ MySQL tham khảo bộ đệm truy vấn. Nếu bất kỳ client nào đưa ra một truy vấn giống hệt với một truy vấn đã có trong bộ nhớ cache, máy chủ chỉ cần bỏ qua parser, optimizer và thậm chí là thực thi, nó chỉ đơn giản là hiển thị đầu ra từ bộ nhớ cache.</p><p>MySQL cache có thể hữu ích trong môi trường mà bạn có các bảng không thường xuyên thay đổi và máy chủ nhận được nhiều truy vấn giống nhau.</p><p>Một số lưu ý khi sử dụng MySQL cache:</p><ul><li>MySQL cache không được chấp nhận kể từ MySQL 5.7.20 và bị xóa trong MySQL 8.0.</li><li>MySQL cache không hoạt động trong môi trường mà bạn có nhiều máy chủ mysqld cập nhật các MyISAM bảng giống nhau .</li><li>MySQL cache không được hỗ trợ cho các partitioned table và tự động bị vô hiệu hóa cho các truy vấn liên quan đến các partitioned table.</li></ul><h2 style=\"margin-left:0px;\"><strong>Storage Engine Layer</strong></h2><p>Tính năng Storage Engine có thể cắm được làm cho MySQL trở thành lựa chọn độc nhất và ưa thích của hầu hết các developer. MySQL cho phép chúng ta lựa chọn các công cụ lưu trữ khác nhau cho các tình huống và yêu cầu khác nhau. Danh sách các công cụ lưu trữ được hỗ trợ được đề cập bên dưới.</p><ul><li>MyISAM.</li><li>InnoDB.</li><li>Federated.</li><li>Mrg_MyISAM.</li><li>Blackhole.</li><li>CSV.</li><li>Memory.</li><li>Archive.</li><li>Performance_schema.</li></ul><p>MySQL cung cấp điều này như một công cụ lưu trữ có thể cắm được, các công cụ lưu trữ khác nhau có thể được sử dụng ở cấp bảng. Lệnh Show engine sẽ liệt kê tất cả các công cụ lưu trữ được hỗ trợ bởi máy chủ của bạn.</p><pre><code class=\"language-plaintext\">mysql&gt; SHOW ENGINES;\n</code></pre><h2 style=\"margin-left:0px;\"><strong>Kết luận</strong></h2><p>Với vốn kiến thức hạn hẹp của mình mình đã mô tả sợ lược về mô hình kiến trúc của mysql. Mong qua bài viết này các bạn có thể hiểu thêm về cách mà mysql tổ chức cũng như các thành phần chính tạo nên 1 hệ thống quản lý dữ mysql. Link tham khảo: <a href=\"https://www.rathishkumar.in/2016/04/understanding-mysql-architecture.html\">https://www.rathishkumar.in/2016/04/understanding-mysql-architecture.html</a></p><p><a href=\"https://dev.mysql.com/doc\">https://dev.mysql.com/doc</a></p><p><a href=\"https://www.toptal.com/mysql/mysql-master-slave-replication-tutorial#:~:text=MySQL%20replication%20is%20a%20process,database%20servers%20(the%20slaves).&amp;text=However%2C%20general%20principles%20of%20setting,same%20for%20all%20operating%20systems\">https://www.toptal.com/mysql/mysql-master-slave-replication-tutorial#:~:text=MySQL replication is a process,database servers (the slaves).&amp;text=However%2C general principles of setting,same for all operating systems</a>.</p>',_binary '\0',NULL,'','NORMAL','user','2021-07-31 14:42:58.092','user','2021-07-31 14:42:58.092',_binary '\0'),(1096,124,1,'8 Tips To Become A Better Front End Developer','Should I use this plugin or that library? Should I plan this project or dive straight into coding? Should I ask for help or figure it out myself?','<h4 style=\"margin-left:0px;\">1. Plan your projects</h4><h4 style=\"margin-left:0px;\">2. Be Proactive</h4><h4 style=\"margin-left:0px;\">3. Be curious</h4><h4 style=\"margin-left:0px;\">4. Invest in your skills</h4><h4 style=\"margin-left:0px;\">5. Don’t say YES to everything</h4><h4 style=\"margin-left:0px;\">6. Don’t say NO to everything</h4><h4 style=\"margin-left:0px;\">7. Find a mentor</h4><h4 style=\"margin-left:0px;\">8. Stay active</h4>',_binary '\0',NULL,'images/img_projects162774285448579527.png','NORMAL','user917','2021-07-31 14:47:39.425','user917','2021-07-31 14:47:39.425',_binary '\0'),(1097,124,1,'Why to Learn java Programming?','Java is a high-level programming language originally developed by Sun Microsystems and released in 1995','<p style=\"margin-left:0.2em;text-align:justify;\">Java is a MUST for students and working professionals to become a great Software Engineer specially when they are working in Software Development Domain. I will list down some of the key advantages of learning Java Programming:</p><p style=\"margin-left:0.2em;text-align:justify;\"><strong>Object Oriented</strong> − In Java, everything is an Object. Java can be easily extended since it is based on the Object model.</p><p style=\"margin-left:0.2em;text-align:justify;\"><strong>Platform Independent</strong> − Unlike many other programming languages including C and C++, when Java is compiled, it is not compiled into platform specific machine, rather into platform independent byte code. This byte code is distributed over the web and interpreted by the Virtual Machine (JVM) on whichever platform it is being run on.</p><p style=\"margin-left:0.2em;text-align:justify;\"><strong>Simple</strong> − Java is designed to be easy to learn. If you understand the basic concept of OOP Java, it would be easy to master.</p><p style=\"margin-left:0.2em;text-align:justify;\"><strong>Secure</strong> − With Javas secure feature it enables to develop virus-free, tamper-free systems. Authentication techniques are based on public-key encryption.</p><p style=\"margin-left:0.2em;text-align:justify;\"><strong>Architecture-neutral</strong> − Java compiler generates an architecture-neutral object file format, which makes the compiled code executable on many processors, with the presence of Java runtime system.</p><p style=\"margin-left:0.2em;text-align:justify;\"><strong>Portable</strong> − Being architecture-neutral and having no implementation dependent aspects of the specification makes Java portable. Compiler in Java is written in ANSI C with a clean portability boundary, which is a POSIX subset.</p><p style=\"margin-left:0.2em;text-align:justify;\"><strong>Robust</strong> − Java makes an effort to eliminate error prone situations by emphasizing mainly on compile time error checking and runtime checking.</p><h2>Hello World using Java Programming.</h2><p style=\"margin-left:0.2em;text-align:justify;\">Just to give you a little excitement about Java programming, Im going to give you a small conventional C Programming Hello World program, You can try it using Demo link.</p><p><a href=\"http://tpcg.io/JFXzYe\">Live Demo</a>public class MyFirstJavaProgram {\n\n &nbsp; /* This is my first java program.\n &nbsp; &nbsp;* This will print Hello World as the output\n &nbsp; &nbsp;*/\n\n &nbsp; public static void main(String []args) {\n &nbsp; &nbsp; &nbsp;System.out.println(\"Hello World\"); // prints Hello World\n &nbsp; }\n}</p><h2>Applications of Java Programming</h2><p style=\"margin-left:0.2em;text-align:justify;\">The latest release of the Java Standard Edition is Java SE 8. With the advancement of Java and its widespread popularity, multiple configurations were built to suit various types of platforms. For example: J2EE for Enterprise Applications, J2ME for Mobile Applications.</p><p style=\"margin-left:0.2em;text-align:justify;\">The new J2 versions were renamed as Java SE, Java EE, and Java ME respectively. Java is guaranteed to be <strong>Write Once, Run Anywhere.</strong></p><p style=\"margin-left:0.2em;text-align:justify;\"><strong>Multithreaded</strong> − With Javas multithreaded feature it is possible to write programs that can perform many tasks simultaneously. This design feature allows the developers to construct interactive applications that can run smoothly.</p><p style=\"margin-left:0.2em;text-align:justify;\"><strong>Interpreted</strong> − Java byte code is translated on the fly to native machine instructions and is not stored anywhere. The development process is more rapid and analytical since the linking is an incremental and light-weight process.</p><p style=\"margin-left:0.2em;text-align:justify;\"><strong>High Performance</strong> − With the use of Just-In-Time compilers, Java enables high performance.</p><p style=\"margin-left:0.2em;text-align:justify;\"><strong>Distributed</strong> − Java is designed for the distributed environment of the internet.</p><p style=\"margin-left:0.2em;text-align:justify;\"><strong>Dynamic</strong> − Java is considered to be more dynamic than C or C++ since it is designed to adapt to an evolving environment. Java programs can carry extensive amount of run-time information that can be used to verify and resolve accesses to objects on run-time.</p><h2>Audience</h2><p style=\"margin-left:0.2em;text-align:justify;\">This tutorial has been prepared for the beginners to help them understand the basic to advanced concepts related to Java Programming language.</p><h2>Prerequisites</h2><p style=\"margin-left:0.2em;text-align:justify;\">Before you start practicing various types of examples given in this reference, we assume that you are already aware about computer programs and computer programming languages.</p><p>&nbsp;</p>',_binary '\0',NULL,'','NORMAL','user917','2021-07-31 14:52:57.074','user917','2021-07-31 14:52:57.074',_binary '\0'),(1098,124,1,'a;lskjdfalhjksdfhjkl','asdlfkjasjkldfhjk','<p>laksjdfklajsdfjklasd askld f ahsdfhaj sdfajsdf d</p>',_binary '\0',NULL,'','NORMAL','user917','2021-07-31 14:54:30.698','user917','2021-08-28 00:53:24.994',_binary ''),(1099,1,1,'aklsjdfajklsdflhjk','sdasdfasdflijkh','<p>klajshdfhkasjdf asdkf asdfklh asdkl jfasdhjklf jklasdf hjkl</p>',_binary '\0',NULL,'','NORMAL','user','2021-07-31 14:55:10.930','user','2021-08-06 17:26:31.644',_binary ''),(1100,1,1,'asdfoals khjdf','asdfasdf  oh oajkshdlf asdf','<p>k ljkhlaksjdfhjkla sdfasdf&nbsp;</p>',_binary '\0',NULL,'','NORMAL','user','2021-07-31 14:56:00.839','user','2021-08-06 17:26:40.240',_binary ''),(1101,124,1,'abcd','abcd','<p>abcd</p>',_binary '\0',NULL,'','NORMAL','user917','2021-07-31 14:56:52.035','user917','2021-08-06 16:54:58.338',_binary ''),(1102,1,1,'ádfasdfas','ádasdf','<p>ádfasdfasdfasdf</p><figure class=\"image\"><img src=\"https://highblog.codes/images/196631011_963931057790911_5806450502741513147_n162774476616444304.jpg\"></figure>',_binary '\0',NULL,'','NORMAL','user','2021-07-31 15:19:27.540','user','2021-08-06 17:26:44.452',_binary ''),(1103,539,1,'test','test','<p>test test</p>',_binary '\0',NULL,'','NORMAL','user6','2021-08-06 15:00:51.364','user6','2021-08-06 15:00:51.364',_binary '\0'),(1104,539,1,'How Prisma and Next.js Fit Together','Next.js blurs the lines between client and server. It supports pre-rendering pages at build time (SSG) or request time (SSR). Prisma is the perfect companion if you need to work with a database in a Next.js app.','<h3 style=\"margin-left:0px;\"><strong>Static Site Generation with Prisma</strong></h3><p style=\"margin-left:0px;\">The getStaticProps function in Next.js is executed at build time for static site generation (SSG). Its commonly used for <i>static</i> pages, like blogs and marketing sites. You can use Prisma inside of getStaticProps to send queries to your database:</p><p style=\"margin-left:0px;\"><span style=\"background-color:rgb(255,255,255);\">Next.js will pass the </span>props<span style=\"background-color:rgb(255,255,255);\"> to your React components, enabling static rendering of your page with dynamic data.</span></p><figure class=\"image\"><img src=\"https://highblog.codes/images/download162826276516937988.png\"></figure><p style=\"margin-left:0px;\"><i>Next.js and Prisma is the <strong>ultimate combo</strong> if you need a database in React apps! Depending on your needs, you can query your database with Prisma in Next.js API routes, in getServerSideProps or in getStaticProps for full rendering flexibility and top performance 🚀”</i></p>',_binary '\0',NULL,'','NORMAL','user6','2021-08-06 15:12:58.081','user6','2021-08-06 15:12:58.081',_binary '\0'),(1105,1,1,'Introduction to React Context API','React Context API is a React API that allows one to share state across an entire app. Instead of installing a state management library in your project or prop drilling','<p style=\"margin-left:0;\">React hook that is needed for this purpose is <i>createContext()</i>. It returns a provider and a consumer. The provider, as the name suggests, provides a state to its children whereas the consumer uses the state.</p><p style=\"margin-left:0;\">Example 1: -<br>&nbsp;</p><pre><code class=\"language-plaintext\">import React, { createContext } from \"react\";\n\n// creating a context\nconst StateContext = createContext();\n\nexport default function App() {\n  return (\n    &lt;StateContext.Provider value={56}&gt;\n      &lt;ShowValue /&gt;\n    &lt;/StateContext.Provider&gt;\n  );\n}\n\nfunction ShowValue() {\n  return (\n    &lt;StateContext.Consumer&gt;\n      {(value) =&gt; &lt;p&gt;The display value is: {value}.&lt;/p&gt;}\n    &lt;/StateContext.Consumer&gt;\n  );\n}\n</code></pre><p style=\"margin-left:0;\">&nbsp;</p><blockquote><p style=\"margin-left:0;\">To see the working implementation of the above example, click <a href=\"https://codesandbox.io/s/createcontext-s8p97\"><u>here</u></a>.</p></blockquote><p style=\"margin-left:0;\">In the example above, we created a context. Now think of creating a context as creating a data layer. After the context is created, we wrapped a component (i.e., <i>ShowValue component</i>) in the data layer so that the data or value is accessible in that component. Finally, the data (or value) is fetched using the consumer. Note that the consumer obtains the value passed by the <i>provider</i> without prop drilling.</p><p style=\"margin-left:0;\">Using react Context API lets you avoid passing of props from parent component to children components. Its all good until you need to pass multiple values. In case of retrieving data from multiple parent contexts, a lot of nesting is introduced.<br>&nbsp;</p><pre><code class=\"language-plaintext\">&lt;CurrentUser.Consumer&gt;\n      {user =&gt;\n        &lt;Notifications.Consumer&gt;\n          {notifications =&gt;\n            &lt;header&gt;\n              Welcome back, {user.name}!\n              You have {notifications.length} notifications.\n            &lt;/header&gt;\n          }\n        &lt;/Notifications.Consumer&gt;\n      }\n    &lt;/CurrentUser.Consumer&gt;\n</code></pre><p style=\"margin-left:0;\">&nbsp;</p><p style=\"margin-left:0;\">Therefore, to make the code less verbose we use <i>useContext() hook</i>.</p><h4 style=\"margin-left:0;\">useContext hook: -</h4><p style=\"margin-left:0;\">The useContext() hook provides a way to pass the data or value to any component without using the consumer. Further, it makes the code more readable and reduces cognitive overhead (i.e., the used amount of working memory resources).</p><p style=\"margin-left:0;\">With useContext() hook, the code in example 1 will look like this: -<br>&nbsp;</p><pre><code class=\"language-plaintext\">import React, { createContext, useContext } from \"react\";\n\nconst StateContext = createContext();\nconst useStateValue = () =&gt; useContext(StateContext);\n\nexport default function App() {\n  return (\n    &lt;StateContext.Provider value={56}&gt;\n      &lt;ShowValue /&gt;\n    &lt;/StateContext.Provider&gt;\n  );\n}\n\nfunction ShowValue() {\nconst value = useStateValue();\n  return (\n      &lt;p&gt;The display value is: {value}.&lt;/p&gt;\n    );\n}\n</code></pre><p style=\"margin-left:0;\">&nbsp;</p><blockquote><p style=\"margin-left:0;\">To see the working implementation of the above example, click <a href=\"https://codesandbox.io/s/usecontext-hook-fzh63?file=/src/App.js\"><u>here</u></a>.</p><p style=\"margin-left:0;\">Note: To further manage the state of the app, <i>useReducer() hook</i> is used.</p></blockquote><h3 style=\"margin-left:0;\">Conclusion</h3><p style=\"margin-left:0;\">By using React Context API, we can produce global variables that can be passed around an entire application and avoid prop drilling. For this purpose, the createContext and the useContext hooks are used. In addition, the useReducer hook can also be used in the case of managing the state of the app.</p><p>P.S. Context API should only be used when you need to share state between many components with a lot of nesting.</p>',_binary '\0',NULL,'','NORMAL','user','2021-08-06 15:13:47.517','user','2021-08-06 17:55:28.896',_binary '\0'),(1106,1028,1,'Một số mẹo điều chỉnh hiểu năng trong Mysql','Mysql là hệ quản trị cơ sở dữ liệu phổ biến nhất hiện. Nó mạnh mẽ và hỗ trợ ta rất nhiều thứ tuyệt vời','<h2 style=\"margin-left:0px;\"><strong>Lựa chọn Local Storage Engine phù hợp</strong></h2><p>Mysql hỗ trợ khá nhiều loại Local Storage Engine phù hợp với nhiều mục đích sử dụng khác nhau. Nhưng tôi chỉ giới thiệu 2 loại phổ biến nhất là MyISAM và InnoDB.</p><figure class=\"table\" style=\"width:730px;\"><table style=\"background-color:rgb(255, 255, 255);\"><thead><tr><th style=\"border-bottom:1px solid rgb(214, 214, 215);border-left:1px solid rgb(214, 214, 215);border-right:1px solid rgb(214, 214, 215);border-top:1px solid rgb(214, 214, 215);padding:0.75rem;vertical-align:top;\">MyISAM</th><th style=\"border-bottom:1px solid rgb(214, 214, 215);border-left:1px solid rgb(214, 214, 215);border-right:1px solid rgb(214, 214, 215);border-top:1px solid rgb(214, 214, 215);padding:0.75rem;vertical-align:top;\">InnoDB</th></tr></thead><tbody><tr><td style=\"border-bottom:1px solid rgb(214, 214, 215);border-left:1px solid rgb(214, 214, 215);border-right:1px solid rgb(214, 214, 215);border-top:1px solid rgb(214, 214, 215);padding:0.75rem;vertical-align:top;\">Hỗ trợ Table - Level Loking</td><td style=\"border-bottom:1px solid rgb(214, 214, 215);border-left:1px solid rgb(214, 214, 215);border-right:1px solid rgb(214, 214, 215);border-top:1px solid rgb(214, 214, 215);padding:0.75rem;vertical-align:top;\">Hỗ trợ Row - Level Locking</td></tr><tr><td style=\"border-bottom:1px solid rgb(214, 214, 215);border-left:1px solid rgb(214, 214, 215);border-right:1px solid rgb(214, 214, 215);border-top:1px solid rgb(214, 214, 215);padding:0.75rem;vertical-align:top;\">Được thiết kế cho nhu cầu về tốc độ (speed)</td><td style=\"border-bottom:1px solid rgb(214, 214, 215);border-left:1px solid rgb(214, 214, 215);border-right:1px solid rgb(214, 214, 215);border-top:1px solid rgb(214, 214, 215);padding:0.75rem;vertical-align:top;\">Được thiết kế để đạt hiệu suất tối đa khi xử lý lượng dữ liệu lớn</td></tr><tr><td style=\"border-bottom:1px solid rgb(214, 214, 215);border-left:1px solid rgb(214, 214, 215);border-right:1px solid rgb(214, 214, 215);border-top:1px solid rgb(214, 214, 215);padding:0.75rem;vertical-align:top;\">Không hỗ trợ Foreign keys vì thế nên chúng ta gọi MySQL với MyISAM là DBMS</td><td style=\"border-bottom:1px solid rgb(214, 214, 215);border-left:1px solid rgb(214, 214, 215);border-right:1px solid rgb(214, 214, 215);border-top:1px solid rgb(214, 214, 215);padding:0.75rem;vertical-align:top;\">Hỗ trợ Foreign keys vì thế nên chúng ta gọi MySQL với InnoDB là RDBMS</td></tr><tr><td style=\"border-bottom:1px solid rgb(214, 214, 215);border-left:1px solid rgb(214, 214, 215);border-right:1px solid rgb(214, 214, 215);border-top:1px solid rgb(214, 214, 215);padding:0.75rem;vertical-align:top;\">Lưu trữ tables, data, indexes của nó trong không gian đĩa bằng cách sử dụng 3 file riêng biệt (table_name.FRM, table_name.MYD, table_name.MYI)</td><td style=\"border-bottom:1px solid rgb(214, 214, 215);border-left:1px solid rgb(214, 214, 215);border-right:1px solid rgb(214, 214, 215);border-top:1px solid rgb(214, 214, 215);padding:0.75rem;vertical-align:top;\">Lưu trữ tables, indexes của nó trong 1 không gian bảng</td></tr><tr><td style=\"border-bottom:1px solid rgb(214, 214, 215);border-left:1px solid rgb(214, 214, 215);border-right:1px solid rgb(214, 214, 215);border-top:1px solid rgb(214, 214, 215);padding:0.75rem;vertical-align:top;\">Không hỗ trợ Transaction</td><td style=\"border-bottom:1px solid rgb(214, 214, 215);border-left:1px solid rgb(214, 214, 215);border-right:1px solid rgb(214, 214, 215);border-top:1px solid rgb(214, 214, 215);padding:0.75rem;vertical-align:top;\">Có hỗ trợ Transaction</td></tr><tr><td style=\"border-bottom:1px solid rgb(214, 214, 215);border-left:1px solid rgb(214, 214, 215);border-right:1px solid rgb(214, 214, 215);border-top:1px solid rgb(214, 214, 215);padding:0.75rem;vertical-align:top;\">Hỗ trợ Full</td><td style=\"border-bottom:1px solid rgb(214, 214, 215);border-left:1px solid rgb(214, 214, 215);border-right:1px solid rgb(214, 214, 215);border-top:1px solid rgb(214, 214, 215);padding:0.75rem;vertical-align:top;\">Text Search</td></tr></tbody></table></figure><blockquote><p>Tóm cái váy lại thì nếu ứng dụng của bạn cần truy xuất(SELECT) thông tin nhiều và ít có các action Insert/Update dữ liệu thì nên sử dụng MyISAM để có hiệu suất tốt nhất. Ví dụ như: Blog, News...Ngược lại, Ứng dụng cuả bạn yêu cầu việc Insert/ Update dữ liệu liên tục, và có cả những nghiệp vụ yêu cầu sử dụng transaction như payment,... thì nên sử dụng InnoDB. Ví dụ như : Forum, Socials network,...</p></blockquote><h2 style=\"margin-left:0px;\"><strong>Đừng quên đánh index</strong></h2><p>Bỏ qua những lý thuyết như cây nhị phân hay index kiểu Btree. Thì chúng ta hãy hiểu đơn giản như sau. Nếu 1 câu truy vấn không kết hợp với index thì sql sẽ phải đọc lần lượt tất cả bản ghi trong 1 table. Sau đó lấy ra những bản ghi phù hợp và trả về kết quả cho chúng ta. Nhưng nếu sử dụng index, bằng một magic nào đó, Giống như mục lục của 1 trang sách vại. Ta chỉ cần vào đó và biết được những trang sách mà ta cần ở đâu. Vào đó lấy ra hoy chứ không cần phải lật lần lượt từng trang một =)) Đấy là lý thuyết của một thằng thì lại vài lần thôi các bạn đừng cười :3</p><p>Quay về với thực tại, Chúng ta nên lưu ý 2 điều sau trước khui quyết định đánh index cho 1 trường.</p><ul><li>Index làm tăng tốc độ truy vấn cho các mệnh đề: Order By, Group By, Where, Join,..</li><li>Nhưng cũng chính nó là nguyên nhân của việc insert, update bị chậm. Vì sao ư ? Đơn giản là cái mục lục đang yên đang lành lại phải đánh lại khi có action insert/update. Và nó sẽ trở thành 1 vấn đề nếu các action này là liên tục và lượng data lớn.</li></ul><h2 style=\"margin-left:0px;\"><strong>Truy vấn phức tạp hay nhiều truy vấn</strong></h2><p>Theo lối nhỏ của thiết kế cơ sở dữ liệu nhấn mạnh việc thực hiện càng nhiều công việc càng tốt với càng ít truy vấn càng tốt. Nghe cũng thuyết phục =)) Nhưng lại không hoàn toàn đúng. Cách tiếp cận này về mặt lịch sử tốt hơn vì chi phí truyền thông mạng và chi phí của các giai đoạn parsing và optimization.</p><p>Tuy nhiên, lời khuyên này không áp dụng nhiều cho MySQL, vì nó được thiết kế để xử lý kết nối và ngắt kết nối rất hiệu quả và phản hồi các truy vấn nhỏ và đơn giản rất nhanh chóng. Mạng hiện đại cũng nhanh hơn đáng kể so với trước đây, giảm độ trễ của mạng. Theo 1 thống kê từ trên mạng (không phải VOZ đâu nhé. Các bạn yên tâm =)) ) MySQL có thể chạy hơn 50.000 truy vấn đơn giản mỗi giây trên phần cứng máy chủ hàng hóa và hơn 2.000 truy vấn mỗi giây. Vì vậy việc chạy nhiều truy vấn không nhất thiết là một điều tệ.</p><p>Nếu các đã tìm hiểu về cấu trúc mysql thì hẵn sẽ nhớ đến giai đoạn conection handing parsing và optimization. Nếu chưa nắm rõ thì tôi xin giới thiệu đến các bạn 1 bài về <a href=\"https://viblo.asia/p/tim-hieu-mysql-architecture-RnB5pj9JZPG\">Mysql Architecture</a> cũng của cái thằng thì lại CSDL 2 lần =))</p><h2 style=\"margin-left:0px;\"><strong>Cắt nhỏ một truy vấn</strong></h2><p>Tôi xin dẫn chứng 1 câu nói khá hay như sau: \"Chia để trị =))\". Thật vậy, trong nhiều trường hợp mà phổ biến nhất chính là khi insert/delete dữ liệu. Chúng ta sẽ có rất là nhiều record, có thể liên quan đến vài bảng khác nhau cần thao tác. Nếu cứ cố đấm ăn xôi thì rất có thể xôi hỏng bỏng không . Vậy cho nên lời khuyên của tôi là hãy chia nó thành nhiều câu query nhỏ. Và insert từng đó vào DB thôi nhé :v VD:</p><pre><code class=\"language-plaintext\">rows_affected = 0\ndo {\n   rows_affected = do_query(\n      \"DELETE FROM messages WHERE created &lt; DATE_SUB(NOW(),INTERVAL 3 MONTH)\n      LIMIT 10000\")\n} while rows_affected &gt; 0\n</code></pre><h2 style=\"margin-left:0px;\"><strong>Join Decomposition</strong></h2><p>Nhiều trang web hiệu suất cao sử dụng Join Decomposition. Bạn có thể phân tách một mệnh đề Join bằng cách chạy nhiều truy vấn bảng đơn. Cùng thao khảo ví dụ dưới đây để thấy rõ hơn nhé.</p><pre><code class=\"language-plaintext\">mysql&gt; SELECT * FROM tag\n    -&gt;    JOIN tag_post ON tag_post.tag_id=tag.id\n    -&gt;    JOIN post ON tag_post.post_id=post.id\n    -&gt;WHERE tag.tag=\'mysql\';\n</code></pre><p>Bạn có thể chuyển thành các truy vấn sau:</p><pre><code class=\"language-plaintext\">mysql&gt; SELECT * FROM  tag WHERE tag=\'mysql\';\nmysql&gt; SELECT * FROM  tag_post WHERE tag_id=1234;\nmysql&gt; SELECT * FROM  post WHERE  post.id in (123,456,567,9098,8904);\n</code></pre><p>Điều này thoạt nhìn có vẻ lãng phí vì bạn đã tăng số lượng truy vấn mà không nhận lại được gì. Tuy nhiên, điều bất ngờ thường đến sau&nbsp;</p><figure class=\"image\"><img src=\"https://twemoji.maxcdn.com/2/72x72/1f604.png\" alt=\"😄\"></figure><p>:</p><p>Bộ nhớ đệm có thể hiệu quả hơn. Nhiều ứng dụng caches các đối tượng được ánh xạ trực tiếp đến các bảng. Trong ví dụ này, nếu bạn tìm thấy các bài đăng có id là 123, 567 hoặc 9098 trong bộ nhớ cache, thì chúng có thể bỏ qua việc truy vấn vào lại và lấy kết quả trực tiếp từ bộ nhớ cache.</p><p>Đối với bảng MyISAM, thực hiện một truy vấn trên mỗi bảng sử dụng table locks hiệu quả hơn. Các truy vấn sẽ lock các bảng riêng lẻ dẫn đến thời gian lock tương đối ngắn. Thay vì phải lock tất cả chúng trong một thời gian dài hơn.</p><p>Dễ dàng mở rộng cơ sở dữ liệu bằng cách đặt các bảng trên các máy chủ khác nhau.</p><p>Bản thân các truy vấn có thể hiệu quả hơn. Trong ví dụ này, việc sử dụng một danh sách IN() thay vì một phép Join cho phép MySQL sắp xếp các ID hàng và truy xuất các hàng một cách tối ưu hơn những gì có thể có với Join.</p><p>Bạn có thể giảm các truy cập hàng thừa. Thực hiện phép Join trong <strong>ứng dụng</strong> có nghĩa là bạn chỉ truy xuất mỗi hàng một lần, trong khi phép Join trong <strong>truy vấn</strong> về cơ bản là một quá trình không chuẩn hóa có thể truy cập nhiều lần vào cùng một dữ liệu. Vì lý do tương tự, chẳng hạn tái cấu trúc cũng có thể làm giảm tổng lưu lượng mạng và sử dụng bộ nhớ.</p><p>Ở một mức độ nào đó, bạn có thể xem kỹ thuật này như việc triển khai thủ công một phép Hash Join thay vì thuật toán các vòng lồng nhau mà MySQL sử dụng để thực hiện một phép Join.</p><h2 style=\"margin-left:0px;\"><strong>Cần gì thì lấy đấy</strong></h2><p>Nhiều câu truy vấn đang yêu nhiều dữ liệu hơn mức cần thiết, rồi sau đó lại loại bỏ những thông tin thừa này đi. Điều này khiến cho mysql phải làm việc nhiều hơn, tốn chi phí mạng, tiêu tốn bộ nhớ và tài nguyên CPU trên máy chủ.</p><h2 style=\"margin-left:0px;\"><strong>Lấy ra tất cả các cột:</strong></h2><p>Chúng ta đã khá quen thuộc với câu lệnh SELECT sẽ lấy ra toàn bộ các hàng. Nhưng nếu yêu cầu chỉ là hiển thị thông tin của 10 users thì hãy thêm cho câu truy vẫn của bạn limit(10) nhé.</p><h2 style=\"margin-left:0px;\"><strong>Lấy ra toàn bộ thông tin từ các bảng liên quan</strong></h2><p>Cùng theo dõi câu query dưới đây nhé</p><pre><code class=\"language-plaintext\">mysql&gt; SELECT * FROM test_db.users\n    -&gt; INNER JOIN test_db.comments USING(post_id)\n    -&gt; INNER JOIN test_db.posts USING(user_id)\n    -&gt;WHERE sakila.posts.title = \'yasuo\'\n</code></pre><p>Câu truy vấn trên sẽ lấy ra toàn bộ thông tin cuả 3 bảng users, posts, comments. Thay vào đó chúng ta có thể viết như sau: SELECT test_db.users.* FROM ...</p><h2 style=\"margin-left:0px;\"><strong>Lấy ra tất cả các cột:</strong></h2><p>Đây có thể nói là 1 trong những lỗi cơ bản và phổ biến nhất. Mỗi khi nhìn thấy 1 câu truy vấn có Select *..., Điều đầu tiên bạn nên đặt 1 câu hỏi rằng: \"Liệu chúng ta có cần hết tất cả thông tin ?\". Chắc là không :v. Việc truy vất toàn các cột của 1 bảng có thể dẫn đến việc ngăn cản tối ưu hoá như covering indexes, tăng I/O, bộ nhớ cũng như chi phí cho máy chủ.</p><h2 style=\"margin-left:0px;\"><strong>Cẩn thận với Like %</strong></h2><p>Khi truy vẫn với mệnh đề LIKE thì ta hay kết hợp với ký tự % để có thể search hiệu quả hơn. Nhưng hãy cẩn thận vì nếu ta sử dụng Like %keyword thì sẽ gây ra quá trình quét toàn bộ bảng. Và kiến câu query của bạn trở nên so bad.</p><h2 style=\"margin-left:0px;\"><strong>Chỉ sử dụng DISTINCT và UNION khi cần thiết</strong></h2><p>Việc sử dụng các toán tử UNION và DISTINCT mà không có bất kỳ mục đích chính nào gây ra việc sắp xếp không mong muốn và làm chậm quá trình thực thi SQL. Thay vì UNION, sử dụng UNION ALL mang lại hiệu quả hơn trong quy trình và cải thiện hiệu suất MySQL chính xác hơn.</p><pre><code class=\"language-plaintext\">mysql&gt; SELECT film_id, description FROM sakila.film ORDER BY title LIMIT 50, 5;\n</code></pre><p>Nếu bảng rất lớn, truy vấn này được viết tốt hơn như sau:</p><pre><code class=\"language-plaintext\">mysql&gt; SELECT film.film_id, film.description\n    -&gt; FROM sakila.film\n    -&gt;    INNER JOIN (\n    -&gt;       SELECT film_id FROM sakila.film\n    -&gt;       ORDER BY title LIMIT 50, 5\n    -&gt;   ) AS lim USING(film_id);\n</code></pre>',_binary '\0',NULL,'images/colorful-palm-silhouettes-background_23-2148541792162826286603371242.jpg','NORMAL','ninhthuanntnt11yopmail','2021-08-06 15:15:50.649','ninhthuanntnt11yopmail','2021-08-06 15:15:50.649',_binary '\0'),(1107,1028,1,'asdf','Test draft','<p>asdf</p>',_binary '\0',NULL,'','NORMAL','ninhthuanntnt11yopmail','2021-08-06 15:16:52.734','ninhthuanntnt11yopmail','2021-08-06 15:16:52.734',_binary '\0'),(1108,539,1,'222222222222','111111111111111','<p>wewewewewewe</p>',_binary '\0',NULL,'','NORMAL','user6','2021-08-06 15:17:36.943','user6','2021-08-06 15:17:36.943',_binary '\0'),(1109,539,1,'The Intuitive\nVue Framework','Build your next Vue.js application with confidence using NuxtJS. An open source framework making web development simple and powerful.','<p><span style=\"background-color:rgb(255,255,255);\">NuxtJS is an MIT licensed open source project and completely free to use. However, the amount of effort needed to maintain and develop new features for the project is not sustainable without proper financial backing. If you run a business and are using Nuxt in a revenue-generating product, it makes business sense to sponsor Nuxt development: it ensures the project that your product relies on stays healthy and actively maintained. It can also help your exposure in the Vue/Nuxt community and makes it easier to attract Vue/Nuxt developers. If you are an individual user and have enjoyed the productivity of using Nuxt, consider donating as a sign of appreciation.</span></p>',_binary '\0',NULL,'','NORMAL','user6','2021-08-06 15:19:53.487','user6','2021-08-06 15:19:53.487',_binary '\0'),(1110,539,1,'C++ \"Hello, World!\" Program','The #include is a preprocessor directive used to include files in our program. The above code is including the contents of the iostream file.\n','<h2 style=\"margin-left:0px;\">C++ \"Hello, World!\" Program</h2><p style=\"margin-left:0px;\">In this example, we will learn to create a simple program named \"Hello World\" in C++ programming.</p><p style=\"margin-left:0px;\">A <strong>\"Hello, World!\"</strong> is a simple program that outputs Hello, World! on the screen. Since its a very simple program, its often used to introduce a new programming language to a newbie.</p><p style=\"margin-left:0px;\">Lets see how C++ \"Hello, World!\" program works.</p><p style=\"margin-left:0px;\">&nbsp;</p><p style=\"margin-left:0px;\">If you havent already set up the environment to run C++ on your computer, visit Install <i>C++ on Your Computer</i>.</p><hr><h2 style=\"margin-left:0px;\">C++ \"Hello World!\" Program</h2><pre><code class=\"language-plaintext\">// Your First C++ Program\n\n#include &lt;iostream&gt;\n\nint main() {\n    std::cout &lt;&lt; \"Hello World!\";\n    return 0;\n}\n</code></pre><p style=\"margin-left:0px;\"><strong>Output</strong></p><p style=\"margin-left:0px;\">Hello World!\n</p><hr><h2 style=\"margin-left:0px;\">Working of C++ \"Hello World!\" Program</h2><ol><li>// Your First C++ Program<br><br>In C++, any line starting with // is a comment. Comments are intended for the person reading the code to better understand the functionality of the program. It is completely ignored by the C++ compiler.</li><li>#include &lt;iostream&gt;<br><br>The #include is a preprocessor directive used to include files in our program. The above code is including the contents of the <strong>iostream</strong> file.<br><br>This allows us to use cout in our program to print output on the screen.<br><br>For now, just remember that we need to use #include &lt;iostream&gt; to use cout that allows us to print output on the screen.</li><li>int main() {...}<br><br>A valid C++ program must have the main() function. The curly braces indicate the start and the end of the function.<br><br>The execution of code beings from this function.</li><li>std::cout &lt;&lt; \"Hello World!\";<br><br>std::cout prints the content inside the quotation marks. It must be followed by &lt;&lt; followed by the format string. In our example, \"Hello World!\" is the format string.<br><br><strong>Note:</strong>&nbsp;; is used to indicate the end of a statement.</li><li>return 0;<br><br>The return 0; statement is the <strong>\"Exit status\"</strong> of the program. In simple terms, the program ends with this statement.</li></ol>',_binary '\0',NULL,'','NORMAL','user6','2021-08-06 15:25:48.025','user6','2021-08-06 15:25:48.025',_binary '\0'),(1114,1028,1,'asdasd','asdasd','<p>asdasd</p>',_binary '\0',NULL,'','NORMAL','ninhthuanntnt11yopmail','2021-08-06 16:55:32.513','ninhthuanntnt11yopmail','2021-08-06 16:55:34.924',_binary ''),(1115,1,1,'🚀10 Trending projects on GitHub for web developers - 6th August 2021','Trending Projects is available as a weekly newsletter please sign up at www.iainfreestone.com to ensure you never miss an issue.','<h3 style=\"margin-left:0;\">1. Radix Primitives</h3><p style=\"margin-left:0;\">An open-source UI component library for building high-quality, accessible design systems and web apps.</p>',_binary '\0',NULL,'','NORMAL','user','2021-08-06 17:32:37.742','user','2021-08-06 18:12:46.290',_binary ''),(1116,539,1,'Why Learn C#?','C# is one of the most popular programming languages and can be used for a variety of things, including mobile applications, game development, and enterprise software. Knowing C# opens a great deal of doors for you as a developer.','<h3><strong>Why Learn C#?</strong></h3><p>C# is one of the most popular programming languages and can be used for a variety of things, including mobile applications, game development, and enterprise software. Knowing C# opens a great deal of doors for you as a developer.</p><h3><strong>Take-Away Skills</strong></h3><p>In this course, you’ll be exposed to fundamental programming concepts using C# and start writing programs right away. You’ll build several projects to help you practice and test your knowledge using quizzes.</p><h3><strong>Upcoming Releases</strong></h3><p>We’re continuing to build new and exciting content for this course! Keep an eye out in upcoming months for new modules that cover object-oriented programming (OOP), control flow, arrays, and loops.</p><p style=\"margin-left:6.25rem;text-align:center;\">Earn<strong>Certificate</strong>of completion with&nbsp;</p><p style=\"margin-left:6.25rem;text-align:center;\">Join<strong>45,000,000+</strong>Codecademy learners</p><p style=\"margin-left:6.25rem;text-align:center;\">Time to Complete<strong>30 Hours</strong></p><p style=\"margin-left:6.25rem;text-align:center;\">Prerequisites<strong>None</strong></p><h3><strong>Codecademy courses have been taken by employees at</strong></h3><figure class=\"image\"><img src=\"https://www.codecademy.com/webpack/c41d5739bf341f298860a4e1c0bd432e.svg\" alt=\"Google Logo\"></figure><figure class=\"image\"><img src=\"https://www.codecademy.com/webpack/6a7687a155efb7887a81c9703b4021c8.svg\" alt=\"Facebook Logo\"></figure><figure class=\"image\"><img src=\"https://www.codecademy.com/webpack/77d0701a433ad10d7ac30c5ed14b13d4.svg\" alt=\"NASA Logo\"></figure><figure class=\"image\"><img src=\"https://www.codecademy.com/webpack/0c078975ab7d71b7643795ab182fb143.svg\" alt=\"IBM Logo\"></figure><figure class=\"image\"><img src=\"https://www.codecademy.com/webpack/a02a53ff8d84511eae365560aaa12a01.svg\" alt=\"Dropbox Logo\"></figure>',_binary '\0',NULL,'','NORMAL','user6','2021-08-06 17:39:17.086','user6','2021-08-06 17:39:17.086',_binary '\0'),(1117,1,1,'dfsdfsdfds','','<p>sdfsdfsdfsdfsdfsdf<strong>sdfsdfsdfsdf</strong></p>',_binary '\0',NULL,'','NORMAL','user','2021-08-06 17:55:55.424','user','2021-08-06 17:55:55.424',_binary '\0'),(1118,1,1,'Hướng dẫn deploy ReactJS without css','','<p>Hello world</p>',_binary '\0',NULL,'','NORMAL','user','2021-08-06 18:13:32.623','user','2021-08-06 18:24:39.190',_binary '\0'),(1119,124,1,'test tags','ksgkagkggk','<p>aaadfghthh</p>',_binary '\0',NULL,'','NORMAL','user917','2021-08-07 00:28:48.941','user917','2021-08-07 00:2